import { PrismaClient } from "@prisma/client";

const prisma = new PrismaClient();

async function seed() {
  const email = 'princessnell@newatlantis.com';

  await prisma.user.upsert({
    where: { email },
    update: {},
    create: {
      name: 'Nellodee',
      email,
      stories: {
        create: {
          title: 'The Tales of Princess Nellodee and her associates.',
          summary: 'The story of the clever princess nell',
          pages: {
            create: {
              prompt: "Princess Nell's sharp mind and quick wit were her greatest weapons, and she used them to protect her kingdom from harm.",
              completion: "Princess Nell sounds like a very clever and brave princess! I bet she had all sorts of exciting adventures using her sharp mind and quick wit. I wonder what kind of challenges she faced in protecting her kingdom? Maybe she had to outsmart a tricky dragon or solve a riddle to save her people. What do you think happened next in Princess Nell's story?",
              summary: "Princess Nell, with her sharp mind and quick wit, stood proudly in front of her kingdom, ready to protect it from any harm that may come its way.",
              image: ``,
              pageNum: 1
            }
          }
        }
      }
    }
  })
}

seed()
  .catch((e) => {
    console.error(e);
    process.exit(1);
  })
  .finally(async () => {
    await prisma.$disconnect();
  });